import React from 'react'
import { NavLink } from 'react-router-dom'
import { withModal } from './Navbar-components/PostModal'
import Modal from '@material-ui/core/Modal'
const SignedInLink = ({toggleModal, isModalVisible}) => {
  return (
    <ul className='right'>
    <div className='modal'>
      {isModalVisible && (
        <Modal handleClose={() => toggleModal(!isModalVisible)}>Modal1</Modal>
        )}
      <button onClick={() => toggleModal(!isModalVisible)}>Open</button>
        </div>
      <li><NavLink to='/' className='btn btn-floating pink lighten-1'>SM</NavLink></li>
    </ul>
  )
}
export default SignedInLink
